import React from 'react';

function Email() {
  return (
    <a href="mailto:eduardokae01@hotmail.com?subject=oportunity">
      <img
        alt="enviar email para Caê Calçolari"
        height="40"
        width="160"
        src="https://img.shields.io/badge/Gmail-D14836?style=for-the-badge&logo=gmail&logoColor=white"
        target="_blank"
      />
    </a>
  );
}

export default Email;
